import React, { useState, useEffect } from 'react';

function App() {
	const movies = [
		{ title: 'kossie coder1', year: 2001},
		{ title: 'kossie coder2', year: 2002},
		{ title: 'kossie coder3', year: 2003},
	];

	return (
		<div className="App">
			<h1>Movie list</h1>
			<div>
				<div>{movies[0].title}</div>
				<div>{movies[0].year}</div>
			</div>
		</div>
	);

}

export default App;
